import React, { useState, useEffect } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function EditarTutor() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '', telefone: '', email: '', cpf: '', endereco: '', dataNascimento: ''
  });

  useEffect(() => {
    api.get(`/tutores/${id}`).then(res => setForm(res.data));
  }, [id]);

  const handleChange = e => {
    const { name, value } = e.target;
    setForm(f => ({ ...f, [name]: value }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    await api.put(`/tutores/${id}`, form);
    navigate('/tutores');
  };

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Editar Tutor</h2>
        <div>
          <Link to="/" className="btn btn-outline-secondary me-2">Voltar ao In√≠cio</Link>
          <Link to="/tutores" className="btn btn-secondary">Ver Tutores</Link>
        </div>
      </div>

      <form onSubmit={handleSubmit}>
        <div className="mb-3"><label className="form-label">Nome</label>
          <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">Telefone</label>
          <input name="telefone" className="form-control" value={form.telefone} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">Email</label>
          <input name="email" type="email" className="form-control" value={form.email} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">CPF</label>
          <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">Endere√ßo</label>
          <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">Data de Nascimento</label>
          <input type="date" name="dataNascimento" className="form-control" value={form.dataNascimento} onChange={handleChange} />
        </div>
        <button type="submit" className="btn btn-primary">Salvar</button>
      </form>
    </div>
  );
}
